	(select concat('Vol:', CAST(w.total_volume AS money), '~Avg:', w.avg_price) from binance_volumn_week w where w.gecko_id = can.gecko_id and w.symbol = can.symbol and yyyymmdd = TO_CHAR(NOW() - interval '11 days', 'yyyyMMdd')) as day_11,
