from 
	candidate_coin can,
	binance_volumn_day cur,
	(select * from public.binance_volumn_day pre where hh=TO_CHAR((NOW() - interval '2 hours'), 'HH24')) pre
where 
		cur.hh = TO_CHAR(NOW(), 'HH24')
	and cur.gecko_id = pre.gecko_id 
	and cur.symbol = pre.symbol
	and can.gecko_id = pre.gecko_id 
	and can.symbol = pre.symbol
-- 	and can.coin_gecko_link is not null
	and can.symbol = 'OGN'
-- 	and can.volumn_div_marketcap > 0.3
order by
	can.volumn_div_marketcap desc
